import { Component } from "react";
import { reduxForm } from "redux-form";
import LoginForm from "./LoginForm";
import * as actions from '../../actions';


class NewUser extends Component {
    render() {
        return (
            <div>
                <LoginForm />
            </div>
        )
    }
}

export default reduxForm({
    form: 'loginForm'
})(NewUser);
